import React, { Component } from 'react';
import PropTypes from "prop-types"


class IconItem extends Component {
  changeClickedStatus (event) {
    console.log(this.props.icon.clicked)
  }

  // changeClickedStatus = (event) => {
  //   console.log(this.props.icon.clicked)
  // } 

  render() {
    return (
      <div >

        <img alt={this.props.icon.name} src={this.props.icon.src} data-id={this.props.icon.id} height="80px" onClick={this.changeClickedStatus.bind(this)}/>
      </div>
    );
  }
}

//PropTypes
IconItem.propTypes = {
  icon: PropTypes.object.isRequired
}

export default IconItem;
